// 3 maneiras de se criar um CPF - lanca excecao se for invalido
		Cpf cpf = new Cpf("747.282.248-56");
		Cpf cpf2 = "74728224856";
		Cpf cpf3 = 74728224856;
		Console.WriteLine(cpf3); // prints 747.282.248-56

		// Checar se um CPF eh valido
		Cpf cpf4;

		if (!Cpf.TryParse("74728224856", out cpf4)) {
			// cpf invalido!
		}

// 3 maneiras de se criar um CPF - lanca excecao se for invalido
		Cpf cpf = new Cpf(""747.282.248-56"");
		Cpf cpf2 = ""74728224856"";
		Cpf cpf3 = 74728224856;
		Console.WriteLine(cpf3); // prints 747.282.248-56

		// Checar se um CPF eh valido
		Cpf cpf4;

		if (!Cpf.TryParse(""74728224856"", out cpf4)) {
